import React from "react";

const GetStarted = () => {
    return (
        <React.Fragment>
            <CssBaseline />
            <Container maxWidth="lg">
                <LandingHead />
            </Container>
            <FundedNetworks />
            <Container maxWidth="lg">
                <SubscribegGraph />
                <OpenInvestment />
                <AboutTeamCarousel />
                <InvestorsHome />
                <HowToRaise />
            </Container>
        </React.Fragment>
    )
}
export default GetStarted;
